    if (currentMain === "home_main"){navbar_title = "SKYGPU.NET: Decentralized AI."}

    return (
        <div className="selector">
        <div className="selector_header">
            <h1>Welcome to Skynet.</h1>
        </div>
        <div className="selector_body">
            <p>select an option:</p>
            <div className="selector_options">
                <button className="option"  >Overview</button>
                <button className="option"  >Alfa</button>
                <button className="option"  >Beta</button>
            </div>
        </div>  
        </div>
    );
};

export default Selector;
